import Link from "next/link";

const Logo = () => (
  <>
    <Link href="/">
      <a className="logo">Woo Young Choi</a>
    </Link>
    <style jsx>
      {`
        .logo {
          display: block;
          margin-top: 10px;
          padding-bottom: 5px;
          text-decoration: none;
          font-family: "Georgia, serif";
          font-size: 20px;
          color: #00ace6;
        }
      `}
    </style>
  </>
);

export default Logo;
